(70, 8, '_info_boks_01_title', 'field_5afbed3a1846a'),
(71, 8, 'info_boks_01', 'Killevippen er en lille privat Rudolf Steiner institution som ligger i Odense SØ. Vi lægger vægt på at være et lille overskueligt hus med faste voksne og små grupper af børn.'),
(72, 8, '_info_boks_01', 'field_5afbf12dc22a0'),
(73, 8, 'info_boks_02_title', 'Optagelse på Venteliste'),
(74, 8, '_info_boks_02_title', 'field_5afbee2b1846b'),
(75, 8, 'info_boks_02', 'Det er muligt at skrive jeres barn på venteliste til en plads i Killevippen Vuggestue eller Børnehave. Ca. en gang hver anden måned holder vi åben rundvisning á 45 minutter. Her kan I komme og høre lidt om stedet og møde vores personale.'),
(76, 8, '_info_boks_02', 'field_5afbf1c2e164d'),
(77, 8, 'info_boks_03_title', 'Børn i naturskønne omgivelser'),
(78, 8, '_info_boks_03_title', 'field_5afbf1dc0d74e'),
(79, 8, 'info_boks_03', 'Killevippen har en meget storslået udsigt mod skoven og engen, og naturen og naturens elementer spiller en stor rolle i Killevippens hverdag.'),
