(1119, 437, 'info_boks_02_title', 'Optagelse på Venteliste'),
(1120, 437, '_info_boks_02_title', 'field_5afbee2b1846b'),
(1121, 437, 'info_boks_02', 'Det er muligt at skrive jeres barn på venteliste til en plads i Killevippen Vuggestue eller Børnehave. Ca. en gang hver anden måned holder vi åben rundvisning á 45 minutter. Her kan I komme og høre lidt om stedet og møde vores personale.'),
(1122, 437, '_info_boks_02', 'field_5afbf1c2e164d'),
(1123, 437, 'info_boks_03_title', 'Børn i naturskønne omgivelser'),
(1124, 437, '_info_boks_03_title', 'field_5afbf1dc0d74e'),
(1125, 437, 'info_boks_03', 'Killevippen har en meget storslået udsigt mod skoven og engen, og naturen og naturens elementer spiller en stor rolle i Killevippens hverdag.'),
(1126, 437, '_info_boks_03', 'field_5afbee421846c'),
